import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { hospitalData } from './data';
import AmbulancePage from './AmbulancePage';
import './HomePage.css';

const HomePage = () => {
  const [selectedHospital, setSelectedHospital] = useState('');
  const navigate = useNavigate();

  const handleDropdownChange = (e) => {
    setSelectedHospital(e.target.value);
  };

  const handleSearchSubmit = (e) => {
    e.preventDefault();

    const hospital = hospitalData.find(
      (h) => h.name.toLowerCase() === selectedHospital.toLowerCase()
    );

    if (hospital) {
      navigate(`/details/${hospital.id}`);
    } else {
      alert('Hospital not found. Please select a valid hospital.');
    }
  };

  return (
    <div className="home-page">
      {/* Hospital Section */}
      <div className="card-container">
        <div className="card">
          <img src="/images/hospital.jpg" alt="Search for hospitals" className="hospital-img" />
          <p>Search for hospitals from our list</p>
        </div>
      </div>

      {/* Hospital Search Section */}
      <div className="search-section">
        <div className="scroll-text">
          <span>Find Hospitals & Doctors</span>
        </div>
        <form className="search-container" onSubmit={handleSearchSubmit}>
          <select
            className="hospital-dropdown"
            value={selectedHospital}
            onChange={handleDropdownChange}
          >
            <option value="" disabled>
              Choose a hospital
            </option>
            {hospitalData.map((hospital) => (
              <option key={hospital.id} value={hospital.name}>
                {hospital.name}
              </option>
            ))}
          </select>

          <button type="submit" className="search-button">
            Search
          </button>
        </form>
      </div>

      {/* Ambulance Section Below Hospital Search */}
      <div className="ambulance-section">
        <div className="ambulance-card-container">
          <div className="ambulance-card">
            <img src="/images/ambulance.jpg" alt="Search for ambulances" className="ambulance-img" />
            <p>Search for ambulances from our list</p>
          </div>
        </div>

        {/* Ambulance Search Form */}
        <form className="search-container">
          <select className="hospital-dropdown" defaultValue="">
            <option value="" disabled>
              Choose an ambulance
            </option>
            {/* Add ambulance data options here */}
            {/* Example: */}
            <option value="ambulance1">Ambulance 1</option>
            <option value="ambulance2">Ambulance 2</option>
          </select>

          <button type="submit" className="search-button">
            Search
          </button>
        </form>
      </div>
      <AmbulancePage />
    </div>
  );
};

export default HomePage;
